(63,21,'<h2 style=\"text-align: center;\">\r\n            <span style=\"color: rgba(31,48,225,0.73); font-family: Roboto, Arial, sans-serif;\">\r\n                <span style=\"white-space: pre-wrap;\">Reminder: To Delete. AGREEMENT FOR LEASE&nbsp;</span>\r\n            </span>\r\n        </h2>\r\n        <p style=\"text-align: center;\">\r\n            <span style=\"color: rgba(2,2,10,0.74); font-family: Roboto, Arial, sans-serif;\">\r\n                <span style=\"white-space: pre-wrap;\">This Agreement for Lease is made at Dhaka this day of Jun 12, 2018 of the Chrisian era&nbsp;</span>\r\n            </span>\r\n        </p>\r\n        <p style=\"text-align: center;\">\r\n            <span style=\"color: #111111; font-family: Roboto, Arial, sans-serif;\">\r\n                <span style=\"white-space: pre-wrap;\">BETWEEN</span>\r\n            </span>\r\n        </p>\r\n        <p style=\"text-align: center;\">\r\n            <span style=\"color: #111111; font-family: Roboto, Arial, sans-serif;\">\r\n                <span style=\"white-space: pre-wrap;\">Name: ashraf mahbub, Address: , hereinafter called the Lessor (Which expression where the term so admits or implies shall include and mean her heirs, successors, legal representative, executors, administrator and assigns)- 1St party.&nbsp;</span>\r\n            </span>\r\n        </p>\r\n        <p style=\"text-align: center;\">\r\n            <span style=\"color: #111111; font-family: Roboto, Arial, sans-serif;\">\r\n                <span style=\"white-space: pre-wrap;\">AND</span>\r\n            </span>\r\n        </p>\r\n        <p style=\"text-align: center;\">\r\n            <span style=\"color: #111111; font-family: Roboto, Arial, sans-serif;\">\r\n                <span style=\"white-space: pre-wrap;\">awonuzzaman, (NID: , Occupation:  Addresses:  hereinafter called the Lessee (Which expressions where the term so admits or implies shall include and mean his heirs, successors, legal representatives, executors, administrators and assigns) -2nd party.&nbsp;</span>\r\n            </span>\r\n        </p>\r\n        <p style=\"text-align: center;\">\r\n            <span style=\"color: #111111; font-family: Roboto, Arial, sans-serif;\">\r\n                <span style=\"white-space: pre-wrap;\">\r\n                    <span style=\"color: #111111; font-family: Roboto, Arial, sans-serif;\">\r\n                        <span style=\"white-space: pre-wrap;\">Whereas the Lessor own and possesses of a flat no : 3A of 3 floor measuring 1200 Sft, at Ring Rd, Dhaka, Bangladesh Location: CCCC, Thana: BADDA, District: DHAKA - 1220\r\n        hereinafter called the demised premises and whereas in consideration of the rents hereby reserved and the covenants, conditions and agreements hereafter contained the Lessor has agreed to let and the Lessee has agreed to take the demised premises for a term of five years commencing from the date as per following clause hereunder as office of TObeFILLED TObeFILLED.&nbsp;</span>\r\n                    </span>\r\n                </span>\r\n            </span>\r\n        </p>\r\n        <p style=\"text-align: left;\">\r\n                    <span style=\"color: #111111; font-family: Roboto, Arial, sans-serif;\">\r\n                        <span style=\"white-space: pre-wrap;\">NOW THIS DEED WITHNESSETH AS FOLLOWS:&nbsp;</span>\r\n                    </span>\r\n        </p>\r\n        \r\n        <p style=\"text-align: left;\">1.&nbsp;The rent has been fixed at Tk.  COLORMARKED COLORMARKED COLORMARKED .&nbsp;</p>\r\n        <p style=\"text-align: left;\">2.&nbsp;The Lessee will make monthly payment of rent COLORMARKED by the is\' week of beginning every month for which it is due after deducting the tax/vat along with original paid receipt copy. The Lessor shall pay any kind of tax/vat by herself over monthly rent.&nbsp;</p>\r\n        <p style=\"text-align: left;\">3. The Lessee will pay separately Apartment COLORMARKED COLORMARKED COLORMARKED&nbsp;</p>\r\n        <p style=\"text-align: left;\">4.&nbsp;The interior of the house will be painted once in every two &amp; half Years.&nbsp;</p>\r\n        <p style=\"text-align: left;\">5.&nbsp;The Lessee shall maintain the demised premises in as good a condition as the same is now at the time of signing this agreement and if any loss or damage beyond normal wear and tear is caused to the demised premises by the Lessee during his occupation he shall make good the loss at his cost. In case of natural disaster and an accident, a mutual or neutral investigation has to be done to identify any negligence of both sides.&nbsp;</p>\r\n        <p style=\"text-align: left;\">6.&nbsp;The Lessee shall use the demised premises as the commercial office of NG Solutions System Ltd. and all the internal &amp; external stakeholder of NG Solutions System Ltd. shall be able to visit the office whenever required.&nbsp;</p>\r\n        <p style=\"text-align: left;\">7.&nbsp;The Lessee shall maintain the demised premises nicely and shall not make any addition and major alteration therein.</p>\r\n        <p style=\"text-align: left;\">8. The Lessee shall allow the Lessor to enter the demised premises at all reasonable hours necessary to inspect and examine the condition of the demised premises.&nbsp;</p>\r\n        <p style=\"text-align: left;\">9. The Lessee shall not assign, sublet or in any other manner transfer and part with the possession of the whole or any part of apartment, demised premises.&nbsp;</p>\r\n        <p style=\"text-align: left;\">10.&nbsp;The Lessee shall hand over vacant possession of the demised premises to the Lessor in the afternoon of 30th May, 2022.</p>\r\n        <p style=\"text-align: left;\">11.The tenancy shall be determinable at the option of either party by 60 days\' notice in writing to the other party at any time during the period of tenancy.&nbsp;</p>\r\n        <p style=\"text-align: left;\">12.&nbsp;The tenancy may by extended at option of either party after expiry of the present period of tenancy.&nbsp;</p>\r\n        <p style=\"text-align: left;\">13.&nbsp;In witness the parties hereof have put their signatures hereunder on the day and year first above written.&nbsp;</p>\r\n        <p style=\"text-align: left;\">&nbsp;</p>\r\n        <p style=\"text-align: center;\">&nbsp;</p>\r\n        ',0,1,1,'2018-05-30 11:01:20','2018-06-02 04:05:31'),
